import sys
import os
import math
from collections import deque

"""
    Given a 2D board containing 'X' and 'O', capture all regions surrounded by 'X'.

    A region is captured by flipping all 'O's into 'X's in that surrounded region.

    For example,
    X X X X
    X O O X
    X X O X
    X O X X
    After running your function, the board should be:

    X X X X
    X X X X
    X X X X
    X O X X
"""
def solve(board):
    if not board or not board[0]:
        return

    for i in range(0, len(board)):
        board[i] = list(board[i])

    m, n = len(board), len(board[i])
    for i in range(0, m):
        if board[i][0] == 'O':
            handle(board, i, 0)
        if board[i][n - 1] == 'O':
            handle(board, i, n - 1)

    for j in range(0, n):
        if board[0][j] == 'O':
            handle(board, 0, j)
        if board[m - 1][j] == 'O':
            handle(board, m - 1, j)
    # recover...
    for i in range(0, m):
        for j in range(0, n):
            if board[i][j] == 'O':
                board[i][j] = 'X'
            elif board[i][j] == 'K':
                board[i][j] = 'O'


def handle(board, i, j):
    m, n = len(board), len(board[0])
    q = deque()
    q.append((i, j))

    while q:
        i, j = q[0]
        q.popleft()

        if i < 0 or j < 0 or i >= m or j >= n or board[i][j] == 'X' or board[i][j] == 'K':
            continue
        
        board[i][j] = 'K'
        q.append((i - 1, j))
        q.append((i + 1, j))
        q.append((i, j - 1))
        q.append((i, j + 1))


